        <form action="" method="post">
            <div id="formDisabled">
                <div class="formInput">
                    <label for="nome">Nome:</label>
                    <input type="text" name="nome" id="nome" placeholder="Henrique dos Santos Lima" disabled>            
                </div>
                <div class="formInput">
                    <label for="email">Email:</label>
                    <input type="text" name="email" id="email" placeholder="henriquelima_senac@email.com" disabled>            
                </div>
            </div>
            
            <div class="formInput">
                <label for="senhaAtual">Senha atual:</label>
                <input type="text" name="senhaAtual" id="senhaAtual">
            </div>

            <div class="formInput">
                <label for="senhaNova">Senha nova:</label>
                <input type="text" name="senhaNova" id="senhaNova">
            </div>

            <div class="formInput">
                <label for="confirmarSenhaNova">Confirmar senha nova:</label>
                <input type="text" name="confirmarSenhaNova" id="confirmarSenhaNova">
            </div>

            <div class="formInput">
                <label for="instrumentacao">Instrumentação:</label>
                <select name="instrumentacao" id="instrumentacao" required>
                    <option value="" disabled selected>Selecione...</option>
                    <option value="violao">Violão</option>
                    <option value="guitarra">Guitarra</option>
                    <option value="clarinete">Clarinete</option>
                    <option value="piano">Piano</option>
                </select>

                <div class="tags-container"></div>
            </div>

            <div class="formInput">
                <label for="foto">Foto de perfil:</label>
            
                <div class="formFile">
                  <!-- Botão customizado -->
                    <label for="foto" class="fileBotao">
